INSERT INTO `package_category` VALUES ('1-3-!나홀로!축구!직관','손흥민 직관보러 런던가자 :-)',1,3,'!나홀로!축구!직관','the-ball-488713_1280.jpg','<p>								</p><p>토트넘 직관!<img src=\"./ManagerImgUpload/the-ball-488713_1280.jpg\" style=\"width: 628px;\">\r\n							</p>',3,2),('1-30-!유적!해변!가족','etranger와 함께 떠나는 스톤헨지 3박4일 투어',1,30,'!유적!해변!가족','bg_stonehenge.jpg*simone-daino-5oP6swhedq4-unsplash.jpg*daniel-lee-isMorfbwRZ8-unsplash.jpg','																<p><img src=\"./ManagerImgUpload/bg_stonehenge.jpg\" style=\"width: 50%;\"></p><p><br></p><p><img src=\"./ManagerImgUpload/simone-daino-5oP6swhedq4-unsplash.jpg\" style=\"width: 50%;\"></p><p><img src=\"./ManagerImgUpload/daniel-lee-isMorfbwRZ8-unsplash.jpg\" style=\"width: 50%;\"><br></p><p><br></p><p>세상에 이런일이, 서프라이즈에서도 나온 그 장소..!</p><p>역사지식이 풍부한 가이드와 함께 스톤헨지 투어를 떠나보세오</p>\r\n							\r\n							',2,27),('1-5-!덕후투어!해리포터','해리포터 성덕투어는 에든버러로 ♥',1,5,'!덕후투어!해리포터','IMG_4161.JPG','								볼트모트 무덤부터\r\n다이애건앨리까지~!\r\n버터맥주 먹으면서 관광하자!\r\n							',2,3),('1-9-!해변!리조트!크루즈','맘마미아! 최저가로 만나는 그리스 산토리니 투어',1,9,'!해변!리조트!크루즈','tour-1.jpg','<p>맘마미아! 최저가로 만나는 그리스 산토리니 투어</p><p><span style=\"color: rgb(102, 102, 102); font-family: -apple-system, BlinkMacSystemFont, AppleSDGothicNeo, Helvetica, &quot;맑은  고딕&quot;, &quot;Malgun Gothic&quot;, 돋움, Dotum, sans-serif; font-size: 15px; white-space: pre-wrap;\">I\'ve been cheated by you since I don\'t know when \r\nSo I made up my mind, it must come to an end \r\nLook at me now, will I ever learn? \r\nI don\'t know how but I suddenly lose control \r\nThere\'s a fire within my soul \r\nJust one look and I can hear a bell ring \r\nOne more look and I forget everything, w-o-o-o-oh \r\n\r\nMamma mia, here I go again \r\nMy my, how can I resist you? \r\nMamma mia, does it show again? \r\nMy my, just how much I\'ve missed you \r\nYes, I\'ve been brokenhearted \r\nBlue since the day we parted \r\nWhy, why did I ever let you go? \r\nMamma mia, now I really know, \r\nMy my, I could never let you go</span><br></p>',0,7),('2-11-!온천!체험!초특가!가족','오이타로 떠나는 온천여행 초특가:-)',2,11,'!온천!체험!초특가!가족','tour-4.jpg','<p>오이타로 떠나는 온천여행 초특가ㅇㅇ<br></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n',2,9),('3-7-!가족','아랍에미레이트 타고가는 럭셔리 두바이 투어 4박5일',3,7,'!가족','burj-khalifa-2212978_1920.jpg','<p>&nbsp;럭셔리 두바이 투어 4박5일<br></p>',3,6),('4-6-!나홀로','나홀로 푸켓&사이판 투어',4,6,'!나홀로','saipan.jpg','								푸켓 투어\r\n							',2,4),('4-6-!커플','푸켓투어',4,6,'!커플','bg_11.jpg','								푸켓투어\r\n							',4,5),('4-6-!해변!땡처리!럭셔리!크루즈!아무거나!기타','러시아 횡단 럭셔리 크루즈 투어',4,6,'!해변!땡처리!럭셔리!크루즈!아무거나!기타','shirakawa-go-3968395_1920.jpg*birds-eye-view-2133661_1920.jpg','																																																<p>								</p><p>								</p><p><img src=\"./ManagerImgUpload/shirakawa-go-3968395_1920.jpg\" style=\"width: 628px;\"><img src=\"./ManagerImgUpload/birds-eye-view-2133661_1920.jpg\" style=\"width: 628px;\"><br></p><p>초초초 특가로 나온 러시아 횡단 투어</p><p>:-)</p>\r\n							<p></p>\r\n							<p></p>\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							',3,25),('5-10-!도시!특가','드라마 프렌즈 뉴요커체험 5박6일',5,10,'!도시!특가','bg_newyork.jpg','<p><br></p><p>도심속 다른 세상같은 뉴욕으로 떠나보세요!:-)&nbsp;</p><p>여러분의 안전을 책임지는 베테랑 가이드와 함께라면</p><p>즐겁고 신나게 즐기실 수 있을거에요</p>',1,8),('5-12-!기타!커플','뮤지컬에서만 보지마세요! 시카고 3박4일',5,12,'!기타!커플','chicago.jpg','<p>뮤지컬에서만 보지마세요! 시카고 3박4일<br></p>',0,10),('5-13-!초특가!깃!특가','눈올때는 어디다? 남극이다',5,13,'!초특가!깃!특가','shirakawa-go-3968395_1920.jpg','								<p><img src=\"./ManagerImgUpload/shirakawa-go-3968395_1920.jpg\" style=\"width: 628px;\"><br></p>\r\n							',0,24),('5-13-!호캉스!도시!럭셔리','CSI로만 보던 라스베가스 가보실래요?',5,13,'!호캉스!도시!럭셔리','lasvegas.jpg','<p>CSI로만 보던 라스베가스 가보실래요?<br></p>',0,11),('5-29-!도시!가족!커플!나홀로','[샌프란2연박+야경투어] 미서부 완전일주 9일 (5대캐년/3대도시/요세미티/베이크루즈)',5,29,'!도시!가족!커플!나홀로','daniel-lee-oFHZdXNyD5c-unsplash.jpg*daniel-lee-isMorfbwRZ8-unsplash.jpg','																																<p>																</p><p><img src=\"./ManagerImgUpload/daniel-lee-oFHZdXNyD5c-unsplash.jpg\" style=\"width: 628px;\"><img src=\"./ManagerImgUpload/daniel-lee-isMorfbwRZ8-unsplash.jpg\" style=\"width: 628px;\"><br><